import tempfile
from rossa import ControlValue


controls = [
    {
        "content_type": "image",
        "control_type": "input",
        "influence": 1.0,
        "content": "data:image/jpeg;base64,",
    },
    {
        "content_type": "image",
        "control_type": "mask",
        "influence": 1.0,
        "content": "https://picsum.photos/200",
    },
]


controls = [ControlValue(**control) for control in controls]


for control in controls:
    temp_path = tempfile.NamedTemporaryFile(delete=True).name

    control.save(temp_path)

print("Successfully saved controls to temporary files.")


